import * as React from 'react';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import ImageListItemBar from '@mui/material/ImageListItemBar';
import RedOctober from '../../assets/RedOctober.png'
import YeezyBlack from '../../assets/YeezyBlack.png'
import YeezyFoam from '../../assets/YeezyFoam.png'
import YeezySlide from '../../assets/YeezySlide.png'
import YeezyWave from '../../assets/YeezyWave.png'
import YeezyZebra from '../../assets/YeezyZebra.png'

export default function TitlebarBelowImageList() {
  return (
    <ImageList sx={{ width: 500, height: 450 }}>
      {itemData.map((item) => (
        <ImageListItem key={item.img}>
          <img
            src={`${item.img}?w=248&fit=crop&auto=format`}
            srcSet={`${item.img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={item.title}
            loading="lazy"
          />
          <ImageListItemBar
            title={item.title}
            subtitle={<span>by: {item.price}</span>}
            position="below"
          />
        </ImageListItem>
      ))}
    </ImageList>
  );
}

const itemData = [
  {
    img: '../../assets/YeezyBlack.png',
    title: 'Adidas Yeezy Boost 350 V2',
    price: '$330.00',
  },
  {
    img: {YeezyFoam},
    title: 'Adidas Yeezy Slides',
    price: '$124.00',
  },
  {
    img: {YeezySlide},
    title: 'Adidas Yeezy Foam Runner',
    price: '$227.00',
  },
  {
    img: {YeezyWave},
    title: 'Adidas Yezzy Boost 700 Wave',
    price: '$410.00',
  },
  {
    img: {YeezyZebra},
    title: 'Adidas Yeezy Boost 350 V2 Zebra',
    price: '$348.00',
  },
  {
    img: {RedOctober},
    title: 'Nike Air Yeezy 2 SP Red October',
    price: '$23,250.00',
  },
];
